        <th>ACCIONES</th>
      </tr>
    </thead>
    <tbody>
      <!-- Invertir el orden de los datos -->
      <tr v-for="(row, rowIndex) in [...paginatedData].reverse()" :key="rowIndex">
        <td v-for="(col, colIndex) in visibleColumns" :key="colIndex">
          {{ row[col] !== undefined && row[col] !== null && row[col] !== "" ? row[col] : "N/A" }}
        </td>
        <td>
          <button @click="downloadPDF(row)">üìÑ</button>
        </td>
      </tr>
    </tbody>
  </table>
  <p v-else>CARGANDO DATOS...</p>
</div>


    <!-- Bot√≥n para cargar m√°s datos -->
    <button v-if="hasMoreData" @click="loadMoreData">CARGAR M√ÅS</button>
  </div>
</template>


<script>
import { ref, computed, onMounted } from "vue";
import fetchGoogleSheetData from "@/services/fetchGoogleSheetData.js";
import pdfMake from "pdfmake/build/pdfmake";
import { pdfMakeVFS } from "pdfmake/build/vfs_fonts";



pdfMake.vfs = pdfMakeVFS;
const headerBase64 = 'data:image/png;base64,';
const footerBase64 = 'data:image/png;base64,';

const downloadPDF = (row) => {
  if (!row) {
    console.error("‚ùå Error: Datos no v√°lidos para el PDF.");
    return;
  }

  console.log("Generando PDF con datos:", row);

  // Tabla de asistencia con 5 participantes fijos
  const asistencia = [
