    ],
    // Participante 1 (siempre visible)
    [
      row.nombre || "Nombre no especificado",
      row.cargo || "Cargo no especificado",
      row.asistio || "No registrado",
      row.firmaBase641 ? { image: row.firmaBase641, width: 50 } : "Sin firma"
    ],
    // Participante 2
    [
      row.nombre1 || "-",
      row.cargo1 || "-",
      row.asistio1 || "-",
      row.firmaBase642 ? { image: row.firmaBase642, width: 50 } : "-"
    ],
    // Participante 3
    [
      row.nombre2 || "-",
      row.cargo2 || "-",
      row.asistio2 || "-",
      row.firmaBase643 ? { image: row.firmaBase643, width: 50 } : "-"
    ],
    // Participante 4
    [
      row.nombre3 || "-",
      row.cargo3 || "-",
      row.asistio3 || "-",
      row.firmaBase644 ? { image: row.firmaBase644, width: 50 } : "-"
    ],
    // Participante 5
    [
      row.nombre4 || "-",
      row.cargo4 || "-",
      row.asistio4 || "-",
      row.firmaBase645 ? { image: row.firmaBase645, width: 50 } : "-"
    ]
  ];

  // Tabla de agenda (3 temas fijos)
  const agenda = [
    [
      { text: "N¬∞", style: "header" },
      { text: "TEMAS", style: "header" },
      { text: "ABORDADO", style: "header" },
      { text: "COMPLETO", style: "header" }
    ],
    // Tema 1
    [
      "1",
      { text: row.tema1 || "-", alignment: 'justify' },
      row.abordado1 || "-",
      row.completo1 || "-"
    ],
    // Tema 2
    [
      "2",
      { text: row.tema2 || "-", alignment: 'justify' },
      row.abordado2 || "-",
      row.completo2 || "-"
    ],
    // Tema 3
    [
      "3",
      { text: row.tema3 || "-", alignment: 'justify' },
      row.abordado3 || "-",
      row.completo3 || "-"
    ]
  ];

  // Tabla de desarrollo (3 temas fijos)
  const desarrollo = [
    [
      { text: "N¬∞", style: "header" },
      { text: "TEMA TRATADO", style: "header" }
    ],
    // Tema 1
    [
      "1",
      { text: row.temaTratado1 || "-", alignment: 'justify' }
    ],
    // Tema 2
    [
      "2",
      { text: row.temaTratado2 || "-", alignment: 'justify' }
    ],
    // Tema 3
    [
      "3",
      { text: row.temaTratado3 || "-", alignment: 'justify' }
    ]
  ];

  // Tabla de compromisos (4 compromisos fijos)
  const compromisos = [
    [
      { text: "DESCRIPCI√ìN", style: "header" },
      { text: "RESPONSABLE", style: "header" },
      { text: "FECHA PREVISTA", style: "header" }
    ],
    // Compromiso 1
    [
      { text: row.descripcion1 || "-", alignment: 'justify' },
      row.responsable1 || "-",
      row.fechaPrevista1 || "-"
    ],
    // Compromiso 2
    [
      { text: row.descripcion2 || "-", alignment: 'justify' },
      row.responsable2 || "-",
      row.fechaPrevista2 || "-"
    ],
    // Compromiso 3
    [
      { text: row.descripcion3 || "-", alignment: 'justify' },
      row.responsable3 || "-",
      row.fechaPrevista3 || "-"
    ],
    // Compromiso 4
    [
      { text: row.descripcion4 || "-", alignment: 'justify' },
      row.responsable4 || "-",
      row.fechaPrevista4 || "-"
    ]
  ];

  // Definici√≥n del documento PDF (igual que antes)
  const docDefinition = {
    pageSize: "LETTER",
    pageMargins: [40, 60, 40, 60],
    header: () => ({
      columns: [
        { width: '10%', text: '' },
        { image: headerBase64, width: 600, alignment: 'center' },
        { width: '*', text: '' }
      ]
    }),
    footer: (currentPage, pageCount) => ({
      columns: [
        { width: '*', text: '' },
        { image: footerBase64, width: 500, alignment: 'center' },
        { width: '*', text: '' }
      ],
      margin: [80, 0, 80, -100]
    }),
    content: [
      { text: '', margin: [0, 20, 0, 10] },
      { text: `ACTA # ${row.codigoUnico || "N/A"}`, style: "title", alignment: "center" },
      { text: "Informaci√≥n B√°sica", style: "section" },
      {
        table: {
          widths: ['100%'],
          body: [
            [{ text: "OBJETIVO DE LA REUNI√ìN", style: "header", fillColor: '#7e7e7e', alignment: 'left', margin: [5, 5, 5, 5] }],
            [{ text: row.objetivo || "N/A", alignment: 'justify', margin: [5, 10, 5, 10] }]
          ]
        },
        layout: {
          hLineWidth: (i) => 1
        },
      },
      {
        table: {
          widths: ["20%", "80%"],
          body: [
            [{ text: "Fecha:", bold: true }, { text: row.fecha || "N/A" }],
            [{ text: "Lugar:", bold: true }, { text: row.lugar || "N/A" }],
            [{ text: "Hora Inicio:", bold: true }, { text: row.horaInicio || "N/A" }],
            [{ text: "Hora Fin:", bold: true }, { text: row.horaFin || "N/A" }]
          ]
        }
      },
      { text: "\nAsistencia", style: "section" },
      { table: { widths: ["30%", "30%", "10%", "30%"], body: asistencia } },
      { text: "\nAgenda", style: "section" },
      { table: { widths: ["5%", "66%", "13.5%", "13.5%"], body: agenda } },
      { text: "", margin: [0, 60, 0, 20] },
      { text: "\nDesarrollo de la Reuni√≥n", style: "section", pageBreak: 'before' },
      { table: { widths: ["10%", "90%"], body: desarrollo } },
      { text: "\nCompromisos", style: "section" },
      { table: { widths: ["50%", "25%", "25%"], body: compromisos } },
    ],
    styles: {
      title: { fontSize: 16, bold: true, margin: [0, 0, 0, 10] },
      section: { fontSize: 12, bold: true, margin: [0, 10, 0, 5] },
      header: { fontSize: 11, bold: true, alignment: 'center', fillColor: '#7e7e7e' }
    }
  };

  pdfMake.createPdf(docDefinition).download(`Acta_${row.codigoUnico}.pdf`);
};

export default {
  setup() {
    const data = ref([]);
    const visibleColumns = ref(["codigoUnico", "acta", "lugar", "fecha"]);
    const maxRows = computed(() => data.value.length);
    const currentPage = ref(1);
    const loading = ref(true);
    const hasMoreData = ref(false);
    const searchQuery = ref(""); // Propiedad reactiva para la b√∫squeda
    const columnFilters = ref({ nombre: "", }); // Inicializar columnFilters correctamente

    const paginatedData = computed(() => {
      let filteredData = data.value;

      // Filtro global de b√∫squeda
      if (searchQuery.value) {
        filteredData = filteredData.filter(item => 
          Object.values(item).some(value =>
            value.toString().toLowerCase().includes(searchQuery.value.toLowerCase())
          )
        );
      }

      // Filtro por columnas (si se aplica)
      for (const [column, filter] of Object.entries(columnFilters.value)) {
        if (filter) {
          filteredData = filteredData.filter(item =>
            item[column].toString().toLowerCase().includes(filter.toLowerCase())
          );
        }
      }

      const start = (currentPage.value - 1) * maxRows.value;
      return filteredData.slice(start, start + maxRows.value);
    });

    const loadData = async () => {
      try {
        loading.value = true;
        const sheetData = await fetchGoogleSheetData();
        console.log("Datos obtenidos de Google Sheets:", sheetData);
        data.value = sheetData;
        hasMoreData.value = sheetData.length > maxRows.value;
      } catch (error) {
        console.error("‚ùå Error al cargar los datos:", error);
      } finally {
        loading.value = false;
      }
    };

    const loadMoreData = () => {
      currentPage.value++;
      hasMoreData.value = data.value.length > maxRows.value * currentPage.value;
    };

    const applyFilter = (column, filterValue) => {
      columnFilters.value[column] = filterValue;
    };

    onMounted(loadData);

    return { 
      data, 
      visibleColumns, 
      paginatedData, 
      loading, 
      loadMoreData, 
      hasMoreData, 
      searchQuery, 
      applyFilter, 
      columnFilters, // Aseg√∫rate de que esto sea accesible en el template
      downloadPDF 
    };
  },
};

</script>




